Here is a Solidity contract based on your description:

```solidity
pragma solidity ^0.5.0;

contract Contract {
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    uint256 public zazsupply;
    uint256 public price;
    address payable public creator;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;

    constructor() public payable {
        // Simplify the logic to fit the contract logic description
        // Assume 'name' and 'symbol' are hashed to uint256 before the operation
        uint256 hashName = uint256(keccak256(bytes(name)));
        uint256 hashSymbol = uint256(keccak256(bytes(symbol)));

        if (hashName + ((31 + hashName / 2) / 32) <= hashName) {
            if (hashSymbol + ((31 + hashSymbol / 2) / 32) <= hashSymbol) {
                decimals = 0;
                zazsupply = 0x1312d00;
                if (msg.value == 0) {
                    totalsupply = zazsupply * 10 ** uint(decimals);
                    balanceof[msg.sender] = totalsupply;
                    creator = msg.sender;
                }
            }
            symbol = '0';
        }
        name = '0';
    }

    function () external payable {
        require(msg.value < 0x16345785d8a0000);
        if (price >= 0x6a94d74f430000) {
            if (balanceof[creator] >= 10000) {
                balanceof[msg.sender] += 10000;
                balanceof[creator] -= 10000;
                creator.transfer(0);
            }
        } else if (price >= 0 && price < 0x11c37937e08000 && balanceof[creator] >= 500) {
            balanceof[msg.sender] += 500;
            balanceof[creator] -= 500;
            creator.transfer(0);
        } else if (price < 0x6a94d74f430000 && balanceof[creator] >= 2000 && price >= 0x11c37937e08000) {
            balanceof[msg.sender] += 2000;
            balanceof[creator] -= 2000;
            creator.transfer(msg.value);
        }
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_to != address(0));
        require(balanceof[msg.sender] >= _value);
        require(balanceof[_to] + _value >= balanceof[_to]);

        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }
}
```
Please note that Solidity does not support direct SHA3 calculation in contract and the `keccak256` function is used instead to generate a hash. Also, the transfer function does not transfer any Ether but only updates the token balance of the sender and recipient.
